declare const SQL_QUERY = "\nUPDATE OR IGNORE Turf SET\n  \"id\" = IFNULL(@id, \"id\"), \"shapeId\" = IFNULL(@shapeId, \"shapeId\"), \"createdAt\" = IFNULL(@createdAt, \"createdAt\"), \"updatedAt\" = IFNULL(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"type\" = IFNULL(@type, \"type\"), \"state\" = IFNULL(@state, \"state\"), \"county\" = IFNULL(@county, \"county\"), \"group\" = IFNULL(@group, \"group\"), \"name\" = IFNULL(@name, \"name\"), \"lat\" = IFNULL(@lat, \"lat\"), \"lng\" = IFNULL(@lng, \"lng\"), \"latMin\" = IFNULL(@latMin, \"latMin\"), \"latMax\" = IFNULL(@latMax, \"latMax\"), \"lngMin\" = IFNULL(@lngMin, \"lngMin\"), \"lngMax\" = IFNULL(@lngMax, \"lngMax\"), \"area\" = IFNULL(@area, \"area\")\nWHERE\n  \"id\" = @id\n";
